import "./navbar.css";
function Home() {
    return (
      <div className="App">
        <header className="App-header">
         Welcome to my crocheting blog!
        </header>
        <span>Linked </span><span className="text-bg-primary">In</span>
        <img src={require("../images/LinkedIn Logo.png")} style={{width:100}}/>
        <button className="btn-outline-primary">Testing</button>
      </div>
    );
  }

  export default Home;
